import React from 'react';

function About() {
  return (
    <div>
      <h2>Acerca de</h2>
      <h3>Misión</h3>
      <p>Nuestra misión es promover el conocimiento y la investigación en las ciencias de la tierra, proporcionando servicios de alta calidad y soluciones innovadoras.</p>
      <h3>Objetivos</h3>
      <ul>
        <li>Fomentar la investigación geológica y meteorológica.</li>
        <li>Desarrollar tecnologías avanzadas para la gestión de recursos naturales.</li>
        <li>Promover la educación y la conciencia ambiental.</li>
      </ul>
    </div>
  );
}

export default About;
